import React from 'react';

const ColorOption = ({item, setTheme}) => {
	return (
			<div
			onClick={() => setTheme(item)}
					className='p-4 rounded-lg shadow-sm border h-22 w-[120px] cursor-pointer'>
				{item}
			</div>
	);
};

export default ColorOption;
